import { Navigate } from "react-router-dom"

export let withLoginNavigate = (Component) =>
{
    let compWithLoginNavigate = (props) =>
    { 
        if(props.isAuth)
        {
        return(
           <Component />
        )
        }
        else return <Navigate to='/Login' replace={"true"} />
    }


   return compWithLoginNavigate
}
